import Axios from "axios"

export default function CreateCookie( email, timestamp ) {

    Axios( {
        method: "post",
        url: "http://www.paste.services/access/rememberMe",
        headers: {
            'Content-Type': 'application/json; charset=UTF-8'
        },
        data: {
            "email": email,
            "timestamp": timestamp
        },
    } ).then( ( res ) => {

        console.log( "StoreCookieDatabase: " + res.data )

        return res.data === "1"
    } )
}
